import React from 'react';
import "../App.css";

function Navigation() {
    return (
        <div className="Navigation">
            <div className="leftSide">
                <ul className="menu">
                    <li><link to="#">Menu Course</link></li>
                    <li><link to=" #">Combo Offers</link></li>
                    <li><link to=" #">Watermelon</link></li>
                    <li><link to=" #">Brownies</link></li>
                </ul>
            </div>
           
            
        </div>
    )
}

export default Navigation
